import Head from 'next/head';
import Header from './Header';

const Layout = (props) => {
    return(
        <div>
            <Head>
                <title>Blackseed site</title>
                <link rel="stylesheet" href="https://bootswatch.com/4/materia/bootstrap.min.css" />
            </Head>
            <Header />
            {props.children}
        </div>
    )
}

export default Layout;
